import React from 'react';
import './TableTp.css'
import editPen from '../../../assets/images/edit-pen.svg'
import trashDelete from '../../../assets/images/trash-delete.svg'

const TableTp = ({ dados, fnUpdate, fnDelete }) => {

    useEffect(() => {
        async function getProximosDados() {
            try {
                const promise = await api.get(`/TiposEvento`);

                setNextEvents(promise.data);
            } catch (error) {
                alert("F demaize na API");
            }
        }

        getProximosDados();
    }, []);


    return (
        <table className='table-data' key={dados.IdTipoEvento}>

            <thead className="table-data__head">
                <tr className="table-data__head-row">
                    <th className="table-data__head-title table-data__head-title--big">TÃ­tulo</th>
                    <th className="table-data__head-title table-data__head-title--little">Editar</th>
                    <th className="table-data__head-title table-data__head-title--little">Deletar</th>
                </tr>
            </thead>


            {dados.map(e => {

                return (
                    <tbody>
                        <tr className="table-data__head-row">
                            <td className="table-data__data table-data__data--big">
                                {dados.titulo}
                            </td>

                            <td className="table-data__data table-data__data--little">
                                <img
                                    className="table-data__icon"
                                    src={editPen}
                                    alt=""
                                    onClick={() => fnUpdate()}
                                />
                            </td>

                            <td className="table-data__data table-data__data--little">
                                <img
                                    className="table-data__icon"
                                    src={trashDelete} alt=""
                                    onClick={() => fnDelete()}

                                />
                            </td>
                        </tr>
                    </tbody>
                )
            })}


        </table>
    );
};

export default TableTp;
